import meals from '../../assets/meals.jpg';
import styles from './Header.module.css';

const Header = () => {
  return (
    <>
      <header className={styles.header}>
        <h1>ReactMeals</h1>
        <button>Cart</button>
      </header>
      <div className={styles['main-image']}>
        <img src={meals} alt='Meals' />
      </div>
    </>
  );
};

export default Header;
